INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (5, 0, 1, 1, 9, 1, 0.0, 3001, "vo_minigame_1012_result_1080", 12300148, 1, 2, "まあまあな点数だけど、\n自分的に手ごたえはどう？\nダメだって思ってんなら、\nまだまだ伸びる余地ありね！");
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (5, 0, 1, 2, 9, 1, 2.21, 3001, "vo_minigame_1012_result_1081", 12300149, 8, 2, "うん、中々の出来ね！\nでもあんたはもっといい点\n取れるはずよ！\nもっと頑張りましょうか！");
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (5, 0, 1, 2, 9, 1, 2.46, 3001, "vo_minigame_1012_result_1082", 12300150, 3, 2, "ん～はっきり言って微妙ね！\nま、難しい問題だし、\n勉強すれば\n点数は上がっていくと思うわ！");
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (5, 0, 1, 2, 9, 1, 2.94, 3001, "vo_minigame_1012_result_1083", 12300151, 3, 2, "ん～…\n10点には届かなかったか～\n次は10点越え目指して\n頑張ってみない？");
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (5, 0, 1, 3, 9, 1, 4.19, 3001, "vo_minigame_1012_result_1084", 12300152, 7, 2, "はいお疲れ～\n点数的にはまあまあってとこね！\nま、超難問だし頑張ったわよ");
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (5, 0, 1, 3, 9, 1, 0.0, 3001, "vo_minigame_1012_result_1085", 12300153, 1, 2, "うん、かなり難しい問題なのに\n最後までやり遂げたわね\n次はもっといい点目指してみる？");
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (5, 0, 1, 3, 9, 1, 2.63, 3001, "vo_minigame_1012_result_1086", 12300154, 3, 2, "ちょっとミスが多かったかもね～\nでも間違えた所は復習して\n次は正解するわよー！");
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (1, 0, 1, 1, 4, 1, 5.53, 3001, "vo_minigame_1012_result_1087", 12300155, 3, 2, "あら…あんまり良くない点数ね～\nどうしたの、調子でも悪かった？\n次はもっと頑張りましょうか");
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (1, 9, 3, 1, 4, 1, 0.01, 3001, "vo_minigame_1012_result_1088", 12300156, 3, 2, "ん～…正解数は\n物足りないわね～\nもうちょっと勉強の時間\n増やしちゃおっか？");
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (1, 3, 1, 1, 4, 1, 4.15, 3001, "vo_minigame_1012_result_1089", 12300157, 3, 2, "ん～…あんたならもうちょと\nいい点取れんでしょ～？\nもっと頑張んなさいよ\n期待してやってんだからさ！");
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (1, 9, 9, 2, 4, 1, 0.01, 3001, "vo_minigame_1012_result_1090", 12300158, 9, 2, "ん～今のあんたには、\nこの問題は難しかったかしら…\n難易度下げてチャレンジするのも\nありかもね～？");
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (1, 0, 1, 2, 4, 1, 5.37, 3001, "vo_minigame_1012_result_1091", 12300159, 3, 2, "あんまり出来は良くないわね～\n難しい問題だししょうがないけど\n次はもっと頑張ってほしいわ！");
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (1, 0, 1, 2, 4, 1, 1.44, 3001, "vo_minigame_1012_result_1092", 12300160, 3, 2, "なるほど…\nちょっと苦手な問題が多かった？\nもう一度チャレンジ\nしてみましょうか～");
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (1, 0, 3, 3, 4, 1, 0.0, 3001, "vo_minigame_1012_result_1093", 12300161, 3, 2, "んん～…問題が難しすぎた？\n無理に難しい問題続けるより、\n難易度下げた方が\n勉強の効率良いかもよ～？");
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (1, 3, 9, 3, 4, 1, 2.91, 3001, "vo_minigame_1012_result_1094", 12300162, 3, 2, "…あんまり点数取れなかったわね\nこれはあたしにも難しい問題だし\nそう落ち込まなくても大丈夫！\n次頑張りましょ！");
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (1, 0, 1, 3, 4, 1, 2.61, 3001, "vo_minigame_1012_result_1095", 12300163, 5, 2, "ごめん、ちょっと難しすぎた？\nもう一度チャレンジするも良し、\n難易度を下げるも良し、\nあんたがやる気なら付き合うわ！");
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (0, 1, 2, 1, 0, 1, 3.63, 3001, "vo_minigame_1012_result_1096", 12300164, 4, 2, "ちょっとあんた…\nやる気ないわよね～！？\n次こんな点数取ったら\n怒るわよ！");
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (0, 1, 2, 1, 0, 1, 4.16, 3001, "vo_minigame_1012_result_1097", 12300165, 6, 2, "はあ…自分で何点取ったか\n分かってるわよね～…？\n０点よ０点！　舐めてんの！？");
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (0, 6, 3, 1, 0, 1, 0.01, 3001, "vo_minigame_1012_result_1098", 12300166, 3, 2, "うう～頭痛い…\nあんたのせいよ！\nなに０点って！\nはあ、このままじゃ赤点よ～…");
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (0, 0, 2, 2, 0, 1, 5.75, 3001, "vo_minigame_1012_result_1099", 12300167, 6, 2, "ねえ、あんた本気でやったの？\nまさか適当にやるわけないわよね\n…分かった、\nもう一回チャレンジするのよ！");
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (0, 1, 2, 2, 0, 1, 5.64, 3001, "vo_minigame_1012_result_1100", 12300168, 4, 2, "あ…あんた、０点よ０点…！\nあたしの教え方が悪かった…？\n…燃えてきたわ！\n絶対あんたの学力上げてやる！");
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (0, 8, 4, 2, 0, 1, 5.73, 3001, "vo_minigame_1012_result_1101", 12300169, 8, 2, "ちょっと待って採点ミスかも…\n…いや合ってるわね。はい０点\n…って０点！？\nふざけんなーー！");
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (0, 1, 3, 3, 0, 1, 5.32, 3001, "vo_minigame_1012_result_1102", 12300170, 5, 2, "あらら…０点よ\nま、難しい問題だしね…\n…つっても０点は無いわ！\n一問くらい正解しなさいよ！");
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (0, 9, 9, 3, 0, 1, 2.37, 3001, "vo_minigame_1012_result_1103", 12300171, 3, 2, "残念だけど０点よ\nま、まあ前向きにとらえるなら、\n今が底よ！　どん底！\nあとは上がってくだけね！");
