INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (1, 3, 10, 2, 4, 2, 4.29, 3001, "vo_minigame_1012_result_2092", 22300160, 4, 2, "覚えても、すぐ忘れるんだけど\nどしたらいい？\nあ、そーゆうとき\nフクシューする感じ？");
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (1, 6, 8, 3, 4, 2, 4.64, 3001, "vo_minigame_1012_result_2093", 22300161, 4, 2, "ムズ過ぎ！\n頭パンクするかと思った…！\nヒデサイ、うちの頭\nふぅふぅして～");
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (1, 0, 5, 3, 4, 2, 3.14, 3001, "vo_minigame_1012_result_2094", 22300162, 9, 2, "おにムズ過ぎてテンサゲ～\nでもヒデサイがんばってるし\nうちもがんばる！");
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (1, 0, 4, 3, 4, 2, 6.59, 3001, "vo_minigame_1012_result_2095", 22300163, 7, 2, "ヒデサイと同じ点数で\nちょっち安心したかも\n一緒にがんばろーね！\n置いてっちゃやだよ？");
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (0, 0, 3, 1, 0, 2, 0.0, 3001, "vo_minigame_1012_result_2096", 22300164, 3, 2, "…まあ、これより下はないし\n次は大逆転\n点数爆上がりっしょ！");
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (0, 5, 10, 1, 0, 2, 2.2, 3001, "vo_minigame_1012_result_2097", 22300165, 9, 2, "０点じゃん…\nそだ、次はえんぴつ転がして\n選ぶ作戦やってみる？");
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (0, 6, 4, 1, 0, 2, 0.01, 3001, "vo_minigame_1012_result_2098", 22300166, 4, 2, "考えるの無理な時あるよね…\nヒデサイもそーゆう\n感じだったの？");
