INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (0, 6, 4, 2, 0, 2, 3.22, 3001, "vo_minigame_1012_result_2100", 22300168, 9, 2, "むむむ～…０点…！\n覚えてもすぐ忘れちゃうし\nベンキョーってマジ大変");
